import React from 'react';
import { Link } from 'react-router-dom';
import './RetailerDashboard.css';

const RetailerDashboard = () => {
  const retailerName = "sai";
  const companyName = "sai krupa";

  return (
    <div className="retailer-dashboard">
      <h1>Retailer Dashboard</h1>
      <p>Welcome back, {retailerName} | {companyName}</p>

      <div className="dashboard-nav">
        <Link to="/retailer/dashboard" className="dashboard-btn active">Dashboard</Link>
        <Link to="/retailer/view-farmers" className="dashboard-btn">View Farmers</Link>
        <Link to="/retailer/products" className="dashboard-btn">View Products</Link>
      </div>
    </div>
  );
};

export default RetailerDashboard;
